import { Component } from "react"
import Navbar from "../Navbar/Navbar"

export default class Home extends Component{
    state={
        productName: 'Toshiba c3',
        price: 3000,
        type: 'Mobile Phone'
    }
    render(){
        return(
            <>
            <Navbar/>
              <h1 className="text-cecnter">Product</h1>
              <h3><i class="fa-solid fa-skull-crossbones"></i></h3> {this.state.productName} 
              <h3><i class="fa-solid fa-skull-crossbones"></i></h3> {this.state.price} 
              <h3><i class="fa-solid fa-skull-crossbones"></i></h3> {this.state.type} 

            </>
        )
    }
}
